    }
    return (
        <div>
            <Form>
                <Form.Group>
                    <FloatingLabel
                        label="Contact Person"
                        className="mb-3"
                    >
                        <Form.Control
                            required
                            type="text"
                            placeholder="Contact Person"
                            // value={contactPerson}
                            // onChange={(e) => setContactPerson(e.target.value)}
                        />
                    </FloatingLabel >
                </Form.Group>

                <Form.Group >
                    <FloatingLabel
                        label="Company Name"
                        className="mb-3" >
                        <Form.Control
                            required
                            type="text"
                            placeholder="Company Name"
                            // value={companyName}
                            // onChange={(e) => setCompanyName(e.target.value)}
                        />
                    </FloatingLabel >
                </Form.Group>

                <Form.Group>
                    <FloatingLabel
                        label="Email Address"
                        className="mb-3" >
                        <Form.Control
                            required
                            type="email"
                            placeholder="Email Address"
                            // value={email}
                            // onChange={(e) => setEmail(e.target.value)}
                        /> </FloatingLabel>
                </Form.Group>

                <div className="d-grid gap-2" >
                    <Button variant="success"
                        // type="submit"
                        onClick={handleSubmit} >
                        Submit </Button>
                    <hr />
                </div>
            </Form>
        </div>
    )
}

export default EditForm
